import React, { Component } from 'react'



export default class Table extends Component {
    constructor(props) {
        super(props);
    }
    redirect() {
        if (!this.props.redirectURL) return console.log("redirect !")
    }
    render() {
        return (
            <div>
                <div className="tableWrapper">
                    <table className="table">
                        <thead>
                            <tr>
                                {this.props.columnHearder.map((headerName, title) => {
                                    return <th key={title}>{headerName}</th>
                                })}
                            </tr>
                        </thead>

                        <tbody>

                            <tr>
                                {this.props.rowData.map(dataInRow => {
                                    {/* { console.log("Data in row " + JSON.stringify(dataInRow)) } */ }


                                    dataInRow.map(cellData => {
                                        return <td>{cellData}</td>;
                                    })


                                })}
                            </tr>

                        </tbody>
                    </table>
                </div>
            </div>
        );
    }
}
